window.bookSummaryJSON = "<p>Life's tough as an Elf girl stranded in Earth's realm.&nbsp;&nbsp;</p> <p>When a jaguar shifter drops in out of nowhere and asks for help in tracking down an ancient blood-magic statuette, I say no thank you. I learned a long time ago the key to survival is keeping a low profile. But it's hard to ignore an artifact of the gods powerful enough to blow holes in reality.&nbsp;</p> <p>Enter stalker werewolves in a black Mercedes and magicians trying to capture me. They all think I know where the damned statue is. Then I'm attacked by demons.&nbsp;&nbsp;&nbsp;</p> <p>It wouldn't be so bad, but some of them are really rude. Being rude is a capital crime where I come from.&nbsp;&nbsp;&nbsp;</p> <p>Time for a lesson in manners.&nbsp;&nbsp;</p> <p><i>Contains mature themes.</i></p>"; 
